import React, {useState} from 'react'
import './VSConfPageStyle.css';
import './Components.css';

import imgSource from './resources/treeview.png';
import imgEnterSource from './resources/move.png';

const SettingDisplay = (props) => {
    
    return(
        <div className={"VSConfigPage-panel-setting"}>              
            <p type={props.name}></p>
            <input placeholder={props.description}></input>
        </div>
    );
};

const AppConfigForm = (props) => {
    return (
        <div className={"VSConfigPage-panel"}>
                <form class="form">
                    <h2>App.Config Settings</h2>
                    <SettingDisplay name='Vision Library:' descripcion={'Nombre del vision system...'}></SettingDisplay>
                    <SettingDisplay name='Communications::' descripcion={'N/S del vision system...'}></SettingDisplay>
                    <SettingDisplay name='IP:' descripcion={'IP del vision system...'}></SettingDisplay>
                    <SettingDisplay name='Port:' descripcion={'Puerto del vision system...'}></SettingDisplay>  

                    <h4></h4>
                    <button className="Button-VSConfPage" >Save App.Config</button>
                    <h4></h4>
                </form>
            </div> 
    );
};

const InfoForm = (props) => {
    return (
        <div className={"VSConfigPage-panel"}>
            <form class="form">
                <h2>Information</h2>
                <h4 className={"Info-text-class"}>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla tempus, quam ut maximus dignissim, ipsum eros pellentesque nisi, vitae dictum elit justo posuere sem. Morbi vitae nisl varius, laoreet nisi vel, tincidunt ante. Aliquam bibendum gravida augue, non egestas mauris blandit ut. Fusce quam massa, auctor non nisl id, rutrum molestie justo. Nam eleifend, nisl ut condimentum convallis, nisl est suscipit tellus, et tincidunt ligula eros vel mi. Quisque varius metus in tortor bibendum viverra. Pellentesque varius, purus ut cursus mollis, enim dui euismod dolor, eget egestas nibh ante ut ex. Phasellus vel purus eget leo pretium facilisis. Cras lacinia erat id metus venenatis, in commodo mauris malesuada. Donec nec mi nibh. Pellentesque nec odio vitae nulla sollicitudin ultrices. In lobortis ullamcorper sem, nec imperdiet velit viverra vitae. Nulla euismod elit id massa molestie accumsan at vitae arcu. Ut finibus justo a euismod blandit. Sed ut porta est, eget suscipit ipsum.

                    
                    
                    Sed ac augue a mi consectetur posuere a ut odio. Fusce maximus molestie eleifend. Aliquam at cursus massa. Curabitur augue nisi, facilisis in dapibus a, fringilla et tortor. In hac habitasse platea dictumst. Proin leo lacus, feugiat at volutpat ac, dapibus aliquet ligula. Phasellus hendrerit auctor justo ut tempor. Vivamus vestibulum metus eu justo fringilla feugiat. Morbi purus nibh, mollis hendrerit molestie ut, sagittis non odio. Aliquam feugiat, arcu ut pharetra hendrerit, mauris augue aliquam velit, a auctor turpis ex ac quam. Vestibulum sed sem ac nulla dictum tempus. Nam congue odio non sem scelerisque, et lacinia ex euismod. Cras pellentesque, diam vitae vehicula porta, magna ex ullamcorper ante, et elementum sapien ligula ac sem. In non ligula ligula. Etiam in aliquet augue.

                    Pellentesque semper facilisis eros. Suspendisse tristique magna metus, vel egestas velit cursus vitae. Pellentesque ac turpis nec lectus porta sagittis id sed est. Aenean rutrum condimentum neque, eget tincidunt diam bibendum eu. Maecenas id vestibulum lorem. Mauris a porta justo. Cras ultrices faucibus eros, suscipit interdum risus vehicula quis. Donec facilisis ut lacus id rutrum. Donec finibus, nulla non pellentesque lacinia, diam enim molestie diam, sit amet tempus enim arcu venenatis turpis. Nunc tempus nulla eu eros sodales feugiat. Vestibulum scelerisque elementum lorem, vel iaculis odio. Pellentesque varius sollicitudin nulla nec imperdiet. Nulla fermentum luctus tempor. Suspendisse potenti. Sed sit amet laoreet est. Aenean pretium, purus sed commodo commodo, lacus libero laoreet lorem, a iaculis magna dolor a augue.</h4>
                <button className="Button-VSConfPage" >More info</button>
                <h4></h4>
            </form>
        </div>
    );
};

const SettingsPanel = (props) => {
    
    return(
        <div  className={"VSConfigPage-panel-global"}> 
            <AppConfigForm></AppConfigForm>     
            <div className={"VSConfigPage-panel"}>
                <form class="form">
                    <h2>VisionSystem</h2>
                    <SettingDisplay name='Vision System name:' descripcion={'Nombre del vision system...'}></SettingDisplay>
                    <SettingDisplay name='Serial Number:' descripcion={'N/S del vision system...'}></SettingDisplay>
                    <SettingDisplay name='IP:' descripcion={'IP del vision system...'}></SettingDisplay>
                    <SettingDisplay name='Port:' descripcion={'Puerto del vision system...'}></SettingDisplay>
                    <h4></h4>
                    <button className="Button-VSConfPage" >Save Vision System</button>
                    <h4></h4>
                    <button className="Button-VSConfPage" >Add new</button>
                    <h4></h4>
                </form>
                <form class="form">
                    <h2>VisionSystem</h2>
                    <SettingDisplay name='Vision System name:' descripcion={'Nombre del vision system...'}></SettingDisplay>
                    <SettingDisplay name='Serial Number:' descripcion={'N/S del vision system...'}></SettingDisplay>
                    <SettingDisplay name='IP:' descripcion={'IP del vision system...'}></SettingDisplay>
                    <SettingDisplay name='Port:' descripcion={'Puerto del vision system...'}></SettingDisplay>
                    <h4></h4>
                    <button className="Button-VSConfPage" >Save Vision System</button>
                    <h4></h4>
                    <button className="Button-VSConfPage" >Add new</button>
                    <h4></h4>
                </form>
            </div>          
            <InfoForm></InfoForm>
        </div>
    );
};

export default SettingsPanel;
